import { render } from '@testing-library/react';
import React from "react";
import ReactDOM from "react-dom";
import "./index.css"


const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/250/300";
const img3 = "https://picsum.photos/300/300";
const img4 = "https://picsum.photos/350/300";
const img5 = "https://picsum.photos/400/300";
const link = "https://youthful-benz-7b48bc.netlify.app/";
ReactDOM.render(
  <>
 <h1 className="head">Click on Any Random Picture To Play a Game</h1>
<div className="imgs">
 <img src={img1} alt="randomImages"/>
 <img src={img2} alt="randomImages"/>
 <img src={img3} alt="randomImages"/>
 <img src={img4} alt="randomImages"/>

 <a href={link}><img src={img5} alt="randomImages"/></a>
 </div>

 </>,
 document.getElementById("root")
);
